import {useState} from 'react';

import Button from './Button'

function Contacts(){ 
    const [first_name, setFirst_name] = useState('');
    const [last_name, setLast_name] = useState('');
    const [phone_number, setPhone_number] = useState('');
    const [email, setEmail] = useState('');
    var success = true;

    async function getContacts(e){
        var userID = localStorage.getItem("userID");

        e.preventDefault();
        const res = await fetch('http://localhost:3001/contacts/' + userID, {
            method: 'GET',
            credentials: 'include',
            headers: {
                'Content-Type': 'application/json'
            },
            body: JSON.stringify({
                first_name: first_name,
                last_name: last_name,
                phone_number: phone_number,
                email: email
            })
        });

        var status = await res.status;
        var data = null;

        if(status === 201){
            data = await res.json();
        } 
        else{
            success = false;
        }

        console.log(data);
    }

    async function addContact(e){
        const res = await fetch('http://localhost:3001/contacts/', {
            method: 'POST',
            credentials: 'include',
            headers: {
                'Content-Type': 'application/json'
            },
            body: JSON.stringify({
                first_name: "Rok",
                last_name: "Sekoranja",
                phone_number: "070777371",
                email: "rok.sekoranja@outlook.com"
            })
        });

        var status = await res.status;
        var data = null;

        if(status === 201){
            data = await res.json();
        } 
        else{
            success = false;
        }

        console.log("dummy: " + data);

    }

    return (
        <>
            <Button text="Add contact" onClick={addContact}></Button>
            <Button text="Contacts" onClick={getContacts}/>
        </>
    );
}

export default Contacts;
